            textAlign: "center"
        };

        const contentBoxCSS = {
            width: "100%",
            height: "100%",  
        }

        const centreCSS = {
            display: "flex",
            justifyContent: "center",
            paddingRight: "5%",
            paddingLeft: "5%"
        }


        return(
            <div style={centreCSS}> 
                <div style={infoCSS}>
                    <Title/>
                </div>
                </div>


        );
    }

}
export default Info
